import React, {useState} from "react";
import skills from "./skills.json";

const Skills = () => {

    return <>
		<h2>Skills</h2>
        {
            skills.map((skill, index) => (
                <div key={index}>
					<h4>{"Programming Language: " + skill["Programming Language"]}</h4>

                </div>
            ))
        }
    </>
}

export default Skills
